import HostMainView from "@/views/HostMainView.vue";
import { createWebHistory, createRouter } from "vue-router";

const routes = [
    // {
    //   path: "/login",
    //   component: LoginView,
    // },
    {
      path: "/hosting",
      component: HostMainView
    }
  ];
  const router = createRouter({
    history: createWebHistory(),
    routes,
  });
  export default router;
